    const redirectToLists = () =>{
        navigate('/Lista');
    }
    return (
        <div>
            <header>
                <nav>
                <h2>Movie Diary</h2>
                <ul>
                    <li onClick={redirectToList} >Movies</li>
                    <li>Lists</li>
                </ul>
                </nav>
            </header>
            <p>Welcome to the MovieDiary, a place to savall the movies that you love and create a to watch list</p>
        </div>
    )
}
